import React, { useState } from "react";
import {
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import "./WishlistList.css";

const WishlistList = () => {
  const [items, setItems] = useState([
    { id: 1, firstname: "Julian", lastname: "Meyringer", year: 2022 },
    { id: 2, firstname: "Adrian", lastname: "De Ro", year: 2023 },
    { id: 3, firstname: "Papa", lastname: "Berger", year: 2024 },
    { id: 1, firstname: "Dominik", lastname: "Meyringer", year: 2022 },
    { id: 2, firstname: "Adrian", lastname: "De Ro", year: 2023 },
    { id: 3, firstname: "Papa", lastname: "Berger", year: 2024 },
  ]);

  const handleDelete = (itemId) => {
    setItems((prevItems) => prevItems.filter((item) => item.id !== itemId));
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>Year</TableCell>
            <TableCell>Action</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {items.map((item) => (
            <TableRow key={item.id}>
              <TableCell>
                {item.firstname} {item.lastname}
              </TableCell>
              <TableCell>{item.year}</TableCell>
              <TableCell>
                <IconButton
                  aria-label="delete"
                  onClick={() => handleDelete(item.id)}
                >
                  <DeleteIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    // <List>
    //   {items.map((item) => (
    //     <ListItem key={item.id}>
    //       <ListItemText
    //         primary={`${item.firstname} ${item.lastname} | ${item.year}`}
    //         // Add more ListItemText properties as needed
    //       />
    //       <ListItemSecondaryAction>
    //         <IconButton
    //           edge="end"
    //           aria-label="delete"
    //           onClick={() => handleDelete(item.id)}
    //         >
    //           <DeleteIcon />
    //         </IconButton>
    //       </ListItemSecondaryAction>
    //     </ListItem>
    //   ))}
    // </List>
  );
};

export default WishlistList;
